import React from 'react'
var bcrypt = require('bcryptjs');
var hash = bcrypt.hashSync("bcrypt-connection-secured");
localStorage.setItem("hash", hash)

var ls = localStorage.getItem("hash")
console.log(ls)
function go() {
    window.location = '/cmds'
}

function func(event) {
    let x = event.keyCode
    if (x === 'Enter') {
        this.setState({ go: true })
    }
}

function hi(e) {
    if (e.target.value !== 'Addaccount') {
        alert("goog")
    }
}

function runcmd(e) {
    if (e.target.value !== 'Addaccount') {
        alert("goog")
    }
}

class Admin extends React.Component {
    state = {
        cmd: '',
        go: false
    }
    render() {
        if (this.state.go === true) {
            hi(this.state.cmd)
        }
        return (
            <div>
                <input type="text" required onKeyPress={func} value={this.state.cmd} required onChange={(e) => {this.setState({ cmd: e.target.value }); this.state.cmd.toUpperCase()}} />
                <br />
                <br />
                <button onClick={runcmd}>Run</button>
                <button onClick={go}>Commands</button>
            </div>
        )
    }
}

export default Admin
